import React from 'react'
import { SeparatorContainer, Heading } from './SeparatorElements'

const Separator = () => {
    return (
        <>
            <SeparatorContainer>
                <Heading id="about">PROJECTS</Heading>
            </SeparatorContainer>
        </>
    )
}

export default Separator
